import React, {FC } from 'react';
import { FormControl,Select } from "@material-ui/core";

interface Props {
    handleChange?:(e:any)=>void;
    name?: any;
    value?: any;
    handleBlur?:(e: React.FocusEvent<HTMLInputElement>)=>void;
    fullWidth?:any;
}

const Dropdown: FC<Props> = ({value,handleChange,name,handleBlur,fullWidth }) => {
    return (
        <>
        <Select
          value={value}
          onChange={handleChange}
          onBlur={handleBlur}
          name={name}
          variant="outlined"
           style={{width:"100%"}}
        >
        </Select>
        </>
    )
}
export default Dropdown;
